  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Innoko
  NWR outlines Refuge accomplishments during the 1985 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. The report includes
  a planning section which discusses the master plan. Refuge administration is outlined;
  information about personnel, volunteer programs, funding, and safety is given. Habitat
  management is also covered; subjects include wetlands and fire management. The wildlife
  section of the report discusses waterfowl, shorebirds, raptors, game mammals, fisheries
  resources, and marking and bird banding. The public uses of the Refuge described
  in this report include hunting, trapping, and law enforcement. The equipment and
  facilities section of the report provides information about new construction, equipment
  replacement, and communication systems. Cooperative programs are provided at the
  end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
